import * as React from 'react'

function SvgHamburgerIcon(props) {
  return (
    <svg width="1em" height="1em" viewBox="0 0 20 18" fill="none" {...props}>
      <path
        stroke="currentColor"
        strokeWidth={1.4}
        strokeMiterlimit={4.139}
        strokeLinecap="round"
        d="M.7 1.3h18.6M.7 9.3h18.6M.7 17.3h18.6"
      />
    </svg>
  )
}

export default SvgHamburgerIcon
